// utils/trainLogisticRegression.js

import { LogisticRegression } from 'ml-logistic-regression';

const trainLogisticRegression = (data) => {
  // Extract the features and labels from the data
  const features = data.map((row) => row.slice(0, -1));
  const labels = data.map((row) => row[row.length - 1]);

  // Create a new instance of LogisticRegression
  const classifier = new LogisticRegression();

  // Train the model with the features and labels
  classifier.train(features, labels);

  // Calculate and return the training accuracy
  const predictions = classifier.predict(features);
  const correctPredictions = predictions.filter(
    (prediction, index) => prediction === labels[index]
  );
  const trainingAccuracy = correctPredictions.length / labels.length;

  return trainingAccuracy;
};

export default trainLogisticRegression;
